    "detail": "Perhaps the only surviving photo of a Bean Burrito Especial. Dated March 23, 2005.\nThe Bean Burrito Especial was a legitimate and extremely delicious burrito on the Big Bell Value Menu at Taco Bell. The bean burrito especial was a bean burrito with creamy jalapeno sauce added. Beans, red sauce, onion, cheedar cheese, and creamy jalapeno sauce. Sadly, the burrito could not survive in a Post-9/11 economy, and has been discontinued. \n\nThe origins of the Bean Burrito Especial can be traced to September 28, 2004, with a forum post titled \"Taco Bell's 99 cent Bean Burrito Especial\".[1]"
