    "detail": "Double Steak Grande Quesadilla were a variety of quesadilla served at Taco Bell for a limited time in 2009.\n\nDouble Steak Grande Quesadillas consist of a double portion of thick-cut, marinated steak with three-cheese blend folded inside a thicker flour tortilla, which is then pressed/grilled.\n\nDouble Steak Grande Quesadillas contained 900 calories, 47 grams of fat and 1710 milligrams of sodium."
