    "name": "Nacho Gordita",
    "url": "https://tacobell.fandom.com/wiki/Nacho_Gordita",
    "img": "Pdp_gordita_nacho_cheese.jpg",
    "detail": "The Nacho Gordita was a menu item available at Taco Bell from the mid-2000s until early 2011. It was a warm, pillowy flatbread shell, filled with seasoned ground beef, warm nacho cheese sauce, crisp shredded lettuce, and diced ripe tomatoes.\n\nCustomers could also upgrade this item with marinated and grilled all-white-meat chicken or authentic carne asada steak.\n\nIt was unique in that the standard golden gordita shell was replaced by a white flatbread shell."
