    "img": "TacoBellNachosBellGrande.jpg",
    "detail": "Nachos BellGrande, sometimes spelled Nachos Bell Grande, are the largest serving of nachos found on the regular menu at Taco Bell. Nachos BellGrande contains a heaping portion of crispy tortilla chips topped with ground beef, diced tomatoes, re-fried beans, nacho cheese sauce, and a dollop of sour cream."
