    "detail": "Triple-Layer Nachos are a simple, small nacho dish. The chips are topped with beans, red sauce and nacho cheese.\n\n\nTriple-Layer Nachos used to be part of the now-defunct \"Why Pay More?\" menu from the 2000s, priced at just 79 cents, but they have since moved to Taco Bell's \"Dollar Cravings\" menu."
