    "name": "Beefy Fritos Burrito",
    "url": "https://tacobell.fandom.com/wiki/Beefy_Fritos_Burrito",
    "img": "Beefy_Fritos_Burrito.jpg",
    "detail": "The Beefy Fritos Burrito (not to be confused with the original Chili Cheese-based Frito Burrito) is a discontinued Dollar Menu item. Removed from the menu in August 2020, it was the last remaining item containing Frito-brand corn chips. It's removal occurring at the same time as Potato Bites, it is speculated to have been due to ingredient consolidation and menu simplification. Similar following items would use generic Crunchy Red Strips as a replacement ingredient. The burrito contained Frito Corn Chips, Seasoned Beef, Nacho Cheese and Seasoned Rice[1]."
