    "detail": "The Chicken Caesar Grilled Stuft Burrito was a burrito containing chicken, crunchy red strips, romaine lettuce, and Caesar dressing. It was available in the United States during summer 2003, and made a limited-edition return to Canada in 2008.\n\nThe former menu item has a large cult following through several revival campaign pages on Facebook, and it tops practically every \"bring back an item\" list."
