    "img": "Picture_1.png",
    "detail": "Grilled Stuft Burrito was a style of burrito served at Taco Bell, in which the burrito has been cooked using a Grill Press. The original Grilled Stuft Burrito features a flour tortilla filled with ground beef, beans, rice, a three-cheese blend featuring cheddar, pepperjack and mozzarella, creamy Pepper Jack Sauce, and Fiesta Salsa, although it can be upgraded to included grilled chicken or steak in place of the ground beef. According to Bill Pearce, Chief Marketing Officer of Taco Bell Corp., \"Grilled Stuft Burritos are some of the most popular and portable menu items Taco Bell has to offer.\"\n\nAll locations have discontinued the Grilled Stuft Burrito while being replaced by newer items. Some customers have voiced their outrage [1] over the decision.\n\nA great variety of Grilled Stuft Burritos have come and gone over the years, including:"
