    "img": "Taco-Bell-Loaded-Taco-Burrito.jpg",
    "detail": "The Loaded Taco Burrito is Taco Bell's latest promotional item (as of April 2017).\n\nAs the name suggests, the burrito is a mash-up of a taco and burrito. It consists of a double portion of seasoned beef plus lettuce, tomatoes, shredded cheese, crispy red tortilla strips, sour cream, and avocado ranch, wrapped up in a warm flour tortilla.\n\nAs of April 10, 2017, the item is not available on the Taco Bell website menu, although the window display can be seen at most Taco Bell locations within the United States.\n\nThe menu item has 550 calories, 29 grams of fat, 9 grams of saturated fat, 0.5 grams of trans fat, 50 milligrams of cholesterol, 1130 milligrams of sodium, 52 grams of carbohydrates, 7 grams of fiber, 4 grams of sugar, and 20 grams of protein.[1]"
