    "img": "Double_Chalupa.png",
    "detail": "The Double Chalupa was a menu item at Taco Bell.\n\n\"Ahoy there! What the heck does Chalupa mean anyway?\n\nFirst off… Yes, it’s a real word. It’s Spanish, whose origins come directly out of Ol’ Mexico and is generally defined as a fried tortilla shell, in the shape of a brownish, beigeish, beigeish-brownish small boat, filled with lots of flavorful ingredients. Now imagine a much larger vessel, fully loaded with a double portion* of Taco Bell’s savory seasoned beef piled high with lettuce, tomatoes, shredded cheddar cheese, Nacho Cheese Sauce and reduced-fat sour cream. Sounds like quite the bounty right? Some might call it a boatload of goodness or even a yacht of yumminess. We call it the all new Double Chalupa, and it’s only available for a limited time. So set a course for your local Taco Bell now… or you might just miss the boat.\""
