    "detail": "The Wild Naked Chicken Chalupa was a menu item at Taco Bell.\n\n\"The original Naked Chicken Chalupa is spicy in its own right with an all-white meat, raised without antibiotics crispy chicken shell, kicked up with bold Mexican spices and seasoning and packed with shredded lettuce, tomatoes, cheddar cheese and creamy avocado ranch sauce,\" the chain said in a press release. \"But the new Wilder Naked Chicken Chalupa takes the heat to the next level. Complete with the same crispy fried chicken shell and fillings, the wilder version is topped off with a bold, smoky Wild sauce that is bound to warm up taste buds.\""
