    "detail": "The XXL Chalupa was a specialty menu item available at Taco Bell from summer 2010 until 2011. It came with a $2.99 price tag for the default beef version.\n\nThe XXL Chalupa was 57.5% larger than the original Chalupa, by mass, and carried a double-sized Chalupa shell packed with seasoned ground beef, crispy lettuce, tomatoes, real cheddar cheese and nacho cheese sauce, red strips and topped with reduced fat sour cream."
