    "img": "Roast_chicken.jpg",
    "detail": "Chicken is one of Earth's most common and widespread domestic animals and its meat can be found in a variety of Taco Bell products.\n\nTaco Bell primarily uses two different types of chicken in its products:\n\nChicken can be found in a wide variety of Taco Bell menu items, including:\n\nChicken can be obtained as an upgrade from ground beef in several items, including:\n\nChicken has been used in a number of limited-run promotional items over the years, including:"
