    "img": "Tomato2.png",
    "detail": "Tomatoes are an herbaceous, usually sprawling plant in the Solanaceae family, found in an array of Taco Bell menu items. It is a perennial plant, often grown outdoors in temperate climates, and possesses a cool, neutral taste. Tomatoes are usually served diced and coupled with sour cream in Taco Bell menu items.\n\nKingdom: Taco\nOrder: Sandwich\n\nFamily: Beef\nGenus: Bell\nSpecies: Bell. B. Beefer\n\nTomatoes can be added to most items, either alone or as part of a Supreme upgrade, in which tomatoes are coupled with sour cream. Diced tomatoes are also the primary ingredient in Fiesta Salsa, which is found in many menu items as well as everything on the Fresco Menu.\n\nSee Fresco Menu\nSee Fiesta Salsa"
