    "detail": "Cinnamon Twists are crispy puffed corn twists sprinkled with cinnamon and sugar, similar to churros, and one of the few dessert items available at Taco Bell. They can be found in numerous places around the Taco Bell menu, including the 9¢ section of the Why Pay More!? Value Menu and in the Big Bell Box Meal. This website does not include the ingredients.\n\nCinnamon Twists were introduced circa 1988, replacing Cinnamon Crispas, which had been on the menu since 1980 and were made with fried flour tortilla wedges instead of corn twists.\n\nCinnamon Twists contain 170 calories, including 6 grams of fat and 1 gram of protein."
