  {
    "name": "Taco",
    "url": "https://tacobell.fandom.com/wiki/Taco",
    "img": "CrunchyTaco.jpg",
    "detail": "The taco is the titular culinary unit available at Taco Bell. It consists of a corn or flour tortilla generally stuffed with ground beef and lettuce.\n\nTaco Bell began selling tacos upon the opening of the first Taco Bell restaurant, in 1976. The only taco available was the crunchy taco, and it quickly became a staple of the restaurant. As the number of Taco Bell restaurants expanded, so did demand for a new design. In 1970, the soft taco was released, and became the best-selling menu item of any fast food restaurant for all of 1970 and 1971.\n\nThe taco has since undergone many changes and upgrades, from the Taco Lite of the 1980s, to the Doritos Locos Tacos of today. Tacos are available in many different varieties, including chicken, steak, and beef. Tacos can also have different toppings, including sour cream, lettuce, cheese, tomatoes, rice, and pico de gallo.\n\nVariations on the standard crunchy and soft tacos are abundant, including:"
  },
  {
    "name": "Taco Bell Grande",
    "url": "https://tacobell.fandom.com/wiki/Taco_Bell_Grande",
    "img": null,
    "detail": "The Taco Bell Grande is a limited run taco which fundamentally was a larger sized Taco Supreme topped with sliced black olives."
  },
  {
    "name": "Taco Light",
    "url": "https://tacobell.fandom.com/wiki/Taco_Light",
    "img": "Taco_Lite.png",
    "detail": "The Taco Lite  (also known as the Tacos for broke people) was a menu item at Taco Bell restaurants during the 1980's. The taco consisted of an extra long white flour tortilla shell filled with double the meat (when compared to normal tacos), along with lettuce, tomatoes, sour cream and cheddar cheese.\n\nThe shell was the same kind of shell still used as the bowl for the Taco Salad (light and flaky). The shell, when bitten into, would never splinter down the taco, or cause the entire shell to fail as a normal shell will sometimes do. Instead it would leave an outline of exactly where the bite took place.\n\nIt was on the menu for quite a few years. The running theory as to why the item was discontinued is in the name \"light\". The majority of customers saw this menu item as some sort of \"diet taco\", when in reality, it was very high in calories, due in part to its large size. Customers did not go to Taco Bell to eat a diet taco, so sales were poor.\n\nCurrent Status\n\nSeveral social media outlets have groups requesting the return of the Taco Light. Official word has been given as of October 2020."
  },
  {
    "name": "Taco Supreme",
    "url": "https://tacobell.fandom.com/wiki/Taco_Supreme",
    "img": "Taco-supreme-2_sm.JPG",
    "detail": "The Taco Supreme is an upgrade to the standard-issue taco, in which the supreme treatment has been applied. They are available at all Taco Bell locations and can be ordered with either crunchy or soft shells. You could get it supreme, which added tomato and sour cream.\n\nThe crunchy Taco Supreme contains 200 calories, 12 grams of fat, and 9 grams of protein. The soft variety contains 240 calories with 11 grams of fat and protein."
  },
  {
    "name": "Volcano Taco",
    "url": "https://tacobell.fandom.com/wiki/Volcano_Taco",
    "img": "Volcano_taco.png",
    "detail": "The Volcano Taco is a taco that was initially available in a limited-time release at select Taco Bell locations during the fall of 2008, but have since been added to the permanent menu. Volcano Tacos consist of a distinctive red crunchy taco shell stuffed with ground beef, lettuce, Lava Sauce, and a spicy nacho cheese sauce that was unavailable prior to the introduction of the Volcano Taco.\n\nVolcano Taco is unrelated to the Volcano Burrito, a limited-run promotional item available in 1995 as a tie-in with the film Congo, which was billed as \"the spiciest burrito ever.\"\n\nIn July 2009, the Volcano Taco had returned through 2013 until Taco Bell decided to discontinue this menu item.  \n\nIn March of 2023, Taco Bell announced the return of the Volcano Taco. June 27th 2023 the Volcano Taco was available early for Taco Bell rewards members and made available to the general public on June 29th 2023.   \n\nOne of the most prominent design features of the Volcano Taco is its red crunchy taco shell. To date, it is the only Taco Bell product to utilize an alternative-colored taco shell, other than the Black Jack Taco (featuring a black shell) and the Doritos Locos Taco (featuring an orange Dorito-colored shell). Speculation has raged over whether the Crunchy Red Strips found in items such as the Big Taste Taco originate from the same red-tortilla source material as the Volcano Taco shell.\n\nThe Volcano Taco has been billed in Taco Bell commercials as possibly \"The spiciest taco ever.\" The Volcano Taco has also been included in an incarnation of the Big Bell Box Meal, as well as the Why Pay More!? Value Menu."
  },
  {
    "name": "XXL Steak Crispy Taco",
    "url": "https://tacobell.fandom.com/wiki/XXL_Steak_Crispy_Taco",
    "img": "TacoBell_XXLSteakCrispyTaco.jpg",
    "detail": "The XXL Steak Crispy Taco was a menu item at Taco Bell."
  },
  {
    "name": "Lettuce",
    "url": "https://tacobell.fandom.com/wiki/Lettuce",
    "img": "Double_Decker_Taco.png",
    "detail": "Lettuce is a leafy green vegetable that is a common ingredient in many Taco Bell items, providing both texture and volume to the dish. In most Taco Bell locations, the specific type of lettuce used is shredded iceberg lettuce, which is known for its mild taste and crisp texture.\n\nDespite being a low-calorie and low-fat ingredient, lettuce is still a good source of fiber, vitamins, and minerals. However, it has a relatively low nutritional density compared to other vegetables and is often used more as a filler or garnish than as a primary source of nutrients.\n\nBecause of its low calorie and high fiber content, lettuce is considered one of the healthiest items served at Taco Bell. It can help fill you up without adding too many calories to your meal, making it a great option for those looking to maintain a healthy diet while enjoying fast food.\n\nTaco Bell once featured two different types of lettuce in its menu items: romaine lettuce and iceberg lettuce. Romaine lettuce, with its darker color and more pronounced flavor, was a popular option for those looking for a slightly more robust taste in their dishes. \n\nHowever, in an effort to streamline its menu and focus on its most popular items, Taco Bell made the decision to indefinitely remove romaine lettuce from its offerings. This decision was likely driven by a desire to simplify operations and reduce waste by limiting the number of ingredients used in its dishes.\n\nDespite the removal of romaine lettuce, Taco Bell still offers its customers the same crisp and crunchy texture of iceberg lettuce, which is a staple in many of its menu items. While the absence of romaine lettuce may be disappointing for some, Taco Bell's continued commitment to providing fresh and tasty ingredients ensures that there are still plenty of delicious options to choose from."
  },
  {
    "name": "Pico De Gallo",
    "url": "https://tacobell.fandom.com/wiki/Pico_De_Gallo",
    "img": "Spicy-chicken-Taco.jpg",
    "detail": "Pico De Gallo is a mixture of diced tomatoes, white onions and cilantro that was found in numerous items at Taco Bell. Items found on Taco Bell's Fresco Menu had their cheese and/or sour cream and sauce replaced with Pico De Gallo.\n\nPico De Gallo was discontinued in 2020 and replaced with diced tomatoes when ordering items Fresco style.\n\nA single portion of Pico De Gallo contains 5 calories and no fat.\n\nItems that feature Pico De Gallo other than those featured on the Fresco Menu include:\n\nSpicy Chicken has been discontinued at all locations. The Ultimate Chalupa was only a limited time only offer and is no longer on the menu."
  },
  {
    "name": "Potato",
    "url": "https://tacobell.fandom.com/wiki/Potato",
    "img": "Potato.jpg",
    "detail": "It's a potato. What else do you expect, good sir?\nIt is a potato. During the COVID-19 pandemic, Taco Bell announced the removal of potatoes from the menu. This followed a trend of several fast food restaurants simplifying their menu during the pandemic. However in early 2021, Taco Bell returned the potato in the form of two products, the Spicy Potato Soft Taco and Fiesta Potatoes, while promising to expand the menu with more vegetarian products in the future. "
  },
  {
    "name": "Romaine lettuce",
    "url": "https://tacobell.fandom.com/wiki/Romaine_lettuce",
    "img": "6000196832452.jpg",
    "detail": "Romaine lettuce is a different cultivar of lettuce from the standard iceberg lettuce used on most Taco Bell menu items. Romaine is generally only used on the Cantina items (Power bowl, etc.), but can be substituted/added to other items.\n\nIn 2018, the Centers for Disease Control (CDC) recalled romaine lettuce nationwide due to contamination with E. coli bacteria. This recall was later specified to only apply to lettuce grown in California. Because of this recall, romaine lettuce may not be available at many Taco Bell restaurants."
  },
  {
    "name": "Tomato",
    "url": "https://tacobell.fandom.com/wiki/Tomato",
    "img": "Tomato2.png",
    "detail": "Tomatoes are an herbaceous, usually sprawling plant in the Solanaceae family, found in an array of Taco Bell menu items. It is a perennial plant, often grown outdoors in temperate climates, and possesses a cool, neutral taste. Tomatoes are usually served diced and coupled with sour cream in Taco Bell menu items.\n\nKingdom: Taco\nOrder: Sandwich\n\nFamily: Beef\nGenus: Bell\nSpecies: Bell. B. Beefer\n\nTomatoes can be added to most items, either alone or as part of a Supreme upgrade, in which tomatoes are coupled with sour cream. Diced tomatoes are also the primary ingredient in Fiesta Salsa, which is found in many menu items as well as everything on the Fresco Menu.\n\nSee Fresco Menu\nSee Fiesta Salsa"
  }
